import React, { Component } from 'react';

import './App.css';


class MusicBox extends Component {

    constructor(props) {
      super(props);
      this.state = {
        //repeater: null,
        speed: 50,
      }
    }

    render() {
        console.log(this.props.albumImage);
        return(
            <div id="album-box">

                <img className="album-art" src={this.props.albumImage}></img>
                <br></br>
                <div style={{position:"relative",width:"62px", height:"35px", overflow:"hidden", display:"inline-block"}}>
                    <div style={{position:"absolute",top:"-266px",left:"-5px"}}>    
                        <iframe width="300" height="300" src={this.props.youtubeLink} ></iframe>
                    </div>
                </div>
            </div>
        );
    }

}
export default MusicBox;
